import classes from './Table.module.css';

export default function TablePage({results,initialInvestment}) {
  return(
        <table className={classes.result}>
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
          {results.map((result) => {
            return(
              <tr key={result.savingsEndOfYear}>
                <td>{result.year}</td>
                <td>{result.savingsEndOfYear}</td>
                <td>{result.yearlyInterest}</td>
                <td>
                  {
                    result.yearlyInterest - 
                    initialInvestment - result.yearlyContribution * result.year}</td>
                <td>{initialInvestment + result.yearlyContribution * result.year}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    )
}
